import React from 'react';

class LogoutComponent extends React.Component {
    render() {
        return (
            <div>
                <h1>You are logged out</h1>
                <div className="container">
                    Thank you for using our application.
                </div>
            </div>
        );
    }
}

export default LogoutComponent;
